  \"Evaluation of methods for Canada thistle-free habitat restoration\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-11-23T20:10:42.778432\",\n\t\"name\": \"evaluation-of-methods-for-canada-thistle-free-habitat-restoration\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Efforts to preserve and restore rare habitats,
  such as the tallgrass prairies, are at the core of the U.S. Fish and Wildlife Serviceu2019s
  mission.  This study evaluates planting methodology and seed mixes with the goal
  of recommending optimal methods to reduce infestation of noxious weeds, especially
  Canada thistle (Cirsium arvense), in new restorations.  Three Waterfowl Management
  Districts (Litchfield, Morris, and Fergus Falls) and one National Wildlife Refuge
  (Neal Smith) are participating in the study.  Each WMD contributed two former soybean
  fields and Neal Smith NWR contributed three former soybean fields to the project,
  for a total of nine study fields.Seed mixes encompassing three diversity levels
  (low, medium, and high) were developed such that all Minnesota sites used the same
  seed sources.  Some adjustment in species was necessary for the southern sites at
  Neal Smith, and a fourth, very high diversity mix, was added to the study at the
  refuge.  Proportion of functional groups was kept constant between sites, even though
  species identities had to be adjusted to accommodate local ecotypes.\",\n\t\"license_title\":
